{
	"type": "object",
	"$schema": "https://json-schema.org/draft/2020-12/schema",
	"required": [
		"dbname",
		"user",
		"password"
	],
	"properties": {
		"host": {
			"type": "string",
			"description": "The instance host"
		},
		"port": {
			"type": "integer",
			"description": "The instance port"
		},
		"user": {
			"type": "string",
			"description": "The postgres username"
		},
		"dbname": {
			"type": "string",
			"description": "The database name"
		},
		"sslmode": {
			"enum": [
				"disable",
				"allow",
				"prefer",
				"require",
				"verify-ca",
				"verify-full"
			],
			"type": "string",
			"description": "The sslmode"
		},
		"password": {
			"type": "string",
			"description": "The postgres users password"
		},
		"root_certificate_pem": {
			"type": "string",
			"description": "The root certificate in pe format",
			"default": ""
		}
	}
}

{
	"type": "object",
	"$schema": "https://json-schema.org/draft/2020-12/schema",
	"required": [],
	"properties": {
		"host": {
			"type": "string",
			"format": "hostname",
			"default": "",
			"description": "Hostname of the EdgeDB instance. (Required unless a DSN or an EdgeDB Cloud instance are provided)"
		},
		"port": {
			"type": "number",
			"description": "(Required unless a DSN or an EdgeDB Cloud instance are provided)"
		},
		"user": {
			"type": "string",
			"default": "",
			"description": "Username to use for connecting to the database. (Required unless a DSN or an EdgeDB Cloud instance are provided)"
		},
		"database": {
			"type": "string",
			"default": "",
			"description": "Name of the database to connect to. (Required unless a DSN or an EdgeDB Cloud instance are provided)"
		},
		"password": {
			"type": "string",
			"default": "",
			"description": "(Required unless a secret key for an EdgeDB Cloud instance is provided)"
		},
		"secretKey": {
			"type": "string",
			"default": "",
			"description": "Specifies the secret key to use for authentication with EdgeDB Cloud instances. (Required for EdgeDB Cloud instance)"
		},
		"instanceName": {
			"type": "string",
			"default": "",
			"description": "Only for use with EdgeDB Cloud instances. Format is <github-username>/<instance-name> (Required for EdgeDB Cloud instances unless a DSN is provided)"
		},
		"dsn": {
			"type": "string",
			"default": "",
			"description": "Overrides any other settings except password. (Required unless host, port, user, and database, or an EdgeDB Cloud instance name are provided)"
		}
	}
}
